import Link from 'next/link';

const Menu = () => {
  const linkstyle = {
    marginRight: 15,
  };
  return (
    <div>
      <Link href="/">
        <a style={linkstyle}>Home</a>
      </Link>

      <Link href=" /sobre">
        <a style={linkstyle}>Sobre</a>
      </Link>

      <Link href=" /contato">
        <a style={linkstyle}>Contato</a>
      </Link>
    </div>
  );
};
export default Menu;
